<?php

$ot = Mopar::getOneOt($ot_id);
$solicitud = Mopar::getOneSolicitudByOtId($ot_id);
$vehiculo = Mopar::getOneVehiculo($solicitud->vehiculo_id);
$cliente = Mopar::getOneCliente($vehiculo->cliente_id);
$cliente2 = Mopar::getOneCliente($vehiculo->cliente_id_2);
$client_name = $cliente->nombres;
if ($cliente2) {
    if ($cliente2->apellidoPaterno == $cliente->apellidoPaterno) {
        $client_name .= " & {$cliente2->nombres} {$cliente2->apellidoPaterno}";
    } else {
        $client_name .= " {$cliente->apellidoPaterno} & {$cliente2->nombres} {$cliente2->apellidoPaterno}";
    }
} else $client_name .= " {$cliente->apellidoPaterno}";

$images = [
    'header' => 'data:image/png;base64,',
    'background' => 'data:image/png;base64,',
    'footer' => 'data:image/png;base64,'
];

$html = '';
$html .= '<table style="width: 100%;">';

// header
$html .= '<tr>';
$html .= '<td>';
$html .= '<img src="' . $images['header'] . '" style="width: 100%">';
$html .= '</td>';
$html .= '</tr>';

// content frame open tag
$html .= '<tr>';
$html .= '<td style="height: 750px;">';
$html .= '<img src="' . $images['background'] . '" style="width: 100%; height: 750px;">';
$html .= '<div style="position: absolute; top: 175; left: 0; padding: 0 75px; width: 475px; line-height: 150%;">';

// content
// $html .= '<style type="text/css">#title{ font-family: "Times New Roman", Times, serif; }</style>';
// font-family: Aptos, Aptos_EmbeddedFont, Aptos_MSFontService, Calibri, Helvetica, sans-serif
$html .= '<div id="title" style="text-align: center; width: 100%; font-size: 18px; font-weight: bold;">FHS CONSTRUCTION INC PROPOSAL</div><br>';

$html .= '<div id="client" style="font-size: 11px;">
                    ' . $client_name . '
                    <br> ' . $vehiculo->street_address . ' ' . $vehiculo->address_line_2 . '
                    <br> ' . $vehiculo->city . ', ' . $vehiculo->zip_code . '
                </div>';

$html .= '<br><div id="project_description">
                    <b>Project description</b> ' . str_replace("\n", '<br>', $ot->titulo) . '
                </div>';

if ('' != $ot->site_services) $html .= '<br><div id="site_services">
                    <b>Site services</b> ' . $ot->site_services . '
                </div>';

// detalle open tag
$html .= '<br><div id="detalle" style="padding: 0 25px;">';

$detalles = json_decode($ot->detalle);
$items = $detalles->item;
$prices = $detalles->precio;
$notes = $detalles->observaciones;
$total_price = (float) 0;
for ($row = 0; $row < count($items); $row++) {
    $item_no = $row + 1;
    $total_price += (float) $prices[$row];
    $price = 0 == $ot->price_breakdown ? '' : '$' . number_format($prices[$row], 0);
    $html .= '<table>
                        <tr>
                            <td style="width: 200px"><b>' . $item_no . ') ' . $items[$row] . '</b></td>
                            <td style="width: 250px"></td>
                            <td><b>' . $price . '</b></td>
                        </tr>
                        <tr>
                            <td colspan="3" style="padding: 0 20px;">' . str_replace("\n", '<br>', $notes[$row]) . '</td>
                        </tr>
                    </table>';

    $html .= '<br>';
}

// detalle close tag
$html .= '</div>';

$html .= '<b>Price including the items mentioned above: $' . number_format($total_price, 0) . '</b>';

// content frame close tag
$html .= '</div>';
$html .= '</td>';
$html .= '</tr>';

// footer
$html .= '<tr>';
$html .= '<td>';
$html .= '<img src="' . $images['footer'] . '" style="width: 100%">';
$html .= '</td>';
$html .= '</tr>';

$html .= '</table>';
